<p><input type="number" id="serial" placeholder="Serial" min="1000" max="900000">

<p><small>Remove any zeros at the start of the number.</small></p>

<p id="info"></p>


<p hidden id="notowned">

<input type="text" id="selfinfo" placeholder="Write about this copy" size="70" autocomplete="off">
<button type="submit" onclick="varload()">Submit</button>

</p>


<script>
function load() {
	 document.getElementById("selfinfo").value = ""
	 serialnum = document.getElementById("serial").value
	 

	 document.getElementById("info").innerHTML = window['cloud_wserial_'+serialnum];
	 
	 document.getElementById("notowned").setAttribute("hidden", "true");
	 
	 if (typeof window['cloud_wserial_'+serialnum] === 'undefined' || window['cloud_wserial_'+serialnum] === null) {
		 console.log("new serial");
		 document.getElementById("notowned").removeAttribute("hidden");
		 
	 }
}

function varload() {
	 window['cloud_wserial_'+serialnum] = document.getElementById("selfinfo").value
	 load()
}



</script>
